public static Query defaultCTQuery()
{
    Query salesQuotationHeaderQuery = new Query();

    var salesQuotationTableDS = salesQuotationHeaderQuery.addDataSource(tableNum(SalesQuotationTable));

    LogisticsPostalAddressBaseEntityChangeTrackingHelper::addPostalAddressBasedOnAddressRecIdLink(salesQuotationTableDS, fieldNum(SalesQuotationTable, DeliveryPostalAddress));

    var orderResponsibleWorkerDS = salesQuotationTableDS.addDataSource(tableNum(HcmWorker));
    orderResponsibleWorkerDS.joinMode(JoinMode::OuterJoin);
    orderResponsibleWorkerDS.addLink(fieldNum(SalesQuotationTable, WorkerSalesResponsible), fieldNum(HcmWorker, RecId));

    var orderTakerWorkerDS = salesQuotationTableDS.addDataSource(tableNum(HcmWorker));
    orderTakerWorkerDS.joinMode(JoinMode::OuterJoin);
    orderTakerWorkerDS.addLink(fieldNum(SalesQuotationTable, WorkerSalesTaker), fieldNum(HcmWorker, RecId));

    var dimensionSetEntityDS = salesQuotationTableDS.addDataSource(tableNum(DimensionAttributeValueSet));
    dimensionSetEntityDS.joinMode(JoinMode::OuterJoin);
    dimensionSetEntityDS.addLink(fieldNum(SalesQuotationTable, DefaultDimension), fieldNum(DimensionAttributeValueSet, RecId));

    var custDefaultLocationDS = salesQuotationTableDS.addDataSource(tableNum(CustDefaultLocation));
    custDefaultLocationDS.joinMode(JoinMode::OuterJoin);
    custDefaultLocationDS.addLink(fieldNum(SalesQuotationTable, InvoiceAccount), fieldNum(CustDefaultLocation,AccountNum));

    var dirPartyLocationRoleDS = custDefaultLocationDS.addDataSource(tableNum(DirPartyLocationRole));
    dirPartyLocationRoleDS.addLink(fieldNum(CustDefaultLocation, PartyLocationRole), fieldNum(DirPartyLocationRole, RecId));

    var logisticsLocationRoleDS = dirPartyLocationRoleDS.addDataSource(tableNum(LogisticsLocationRole));
    logisticsLocationRoleDS.addLink(fieldNum(DirPartyLocationRole, LocationRole), fieldNum(LogisticsLocationRole, RecId));

    var dirPartyLocationDS = dirPartyLocationRoleDS.addDataSource(tableNum(DirPartyLocation));
    dirPartyLocationDS.addLink(fieldNum(DirPartyLocationRole, PartyLocation), fieldNum(DirPartyLocation, RecId));

    var invoicePostalAddressDS = dirPartyLocationDS.addDataSource(tableNum(LogisticsPostalAddress));
    invoicePostalAddressDS.addLink(fieldNum(DirPartyLocation, Location), fieldNum(LogisticsPostalAddress, Location));

    var salesQuotationCalcTotalsDS = salesQuotationTableDS.addDataSource(tableNum(SalesQuotationCalculatedTotals));
    salesQuotationCalcTotalsDS.joinMode(JoinMode::OuterJoin);
    salesQuotationCalcTotalsDS.addLink(fieldNum(SalesQuotationTable, QuotationId), fieldNum(SalesQuotationCalculatedTotals, QuotationId));

    return salesQuotationHeaderQuery;
}

/// <summary>
/// Updates the discount and totals for a given entity record.
/// </summary>
/// <param name = "_salesQuotationHeaderEntityRecord">The sales quotation header entity record.</param>
/// <returns>The list of related entities that need to be resynced.</returns>
/// <remarks>
/// This method is aimed to be used by Dual Write to trigger price and discount calculation updates.
/// See <c>RunDocumentAction</c> OData action on the <c>DualWriteProjectConfigurationEntity</c> entity.
/// </remarks>
public static List updatePrices(Common _salesQuotationHeaderEntityRecord)
{
    DNRRentalQuotationHeaderCDSEntity salesQuotationHeaderEntityRecord = _salesQuotationHeaderEntityRecord;
    SalesCDSPrePricingAmountsTmp prePricingAmounts = SalesCDSPrePricingAmountsTmp::initPrePricingAmountsFromQuotationLines(salesQuotationHeaderEntityRecord.SalesQuotationNumber);
    List relatedRecords = new List(Types::Container);

    if (salesQuotationHeaderEntityRecord != null)
    {
        salesQuotationHeaderEntityRecord.calculatePrices();
        relatedRecords = salesQuotationHeaderEntityRecord.getRecordsToSync(prePricingAmounts);
    }

    return relatedRecords;
}

private List getRecordsToSync(SalesCDSPrePricingAmountsTmp _prePricingAmounts)
{
    List recordsToSync = new List(Types::Container);
    recordsToSync.addEnd([this.TableId, this.RecId]);

    DNRRentalQuotationLineCDSEntity salesQuotationLineEntityRecord;

    while select salesQuotationLineEntityRecord
            where salesQuotationLineEntityRecord.SalesQuotationNumber == this.SalesQuotationNumber
        exists join _prePricingAmounts // Only amount fields changed lines to be synced.
            where _prePricingAmounts.ReferenceNumber == salesQuotationLineEntityRecord.SalesQuotationNumber
                && _prePricingAmounts.LineCreationSequenceNumber == salesQuotationLineEntityRecord.LineCreationSequenceNumber
                && (_prePricingAmounts.LineAmount != salesQuotationLineEntityRecord.LineAmount
                    || _prePricingAmounts.LineDisc != salesQuotationLineEntityRecord.LineDiscountAmount
                    || _prePricingAmounts.LinePercent != salesQuotationLineEntityRecord.LineDiscountPercentage
                    || _prePricingAmounts.MultiLnDisc != salesQuotationLineEntityRecord.MultilineDiscountAmount
                    || _prePricingAmounts.MultiLnPercent != salesQuotationLineEntityRecord.MultilineDiscountPercentage
                    || _prePricingAmounts.SalesMarkup != salesQuotationLineEntityRecord.FixedPriceCharges
                    || _prePricingAmounts.SalesPrice != salesQuotationLineEntityRecord.SalesPrice
                    || _prePricingAmounts.TotalTaxAmount != salesQuotationLineEntityRecord.TotalTaxAmount
                    || _prePricingAmounts.TotalChargesAmount != salesQuotationLineEntityRecord.TotalChargesAmount
                    || _prePricingAmounts.TotalDiscountAmount != salesQuotationLineEntityRecord.TotalDiscountAmount)
    {
        recordsToSync.addEnd([salesQuotationLineEntityRecord.TableId, salesQuotationLineEntityRecord.RecId]);
    }

    return recordsToSync;
}

public static container getEntityDataSourceToFieldMapping(container mapping)
{
    mapping += [[dataEntityDataSourceStr(DNRRentalQuotationHeaderCDSEntity, RentalQuotationHeaderEntity), tablenum(LogisticsPostalAddress), fieldstr(DNRRentalQuotationHeaderCDSEntity, DeliveryPostalAddressRecId)],
                [dataEntityDataSourceStr(DNRRentalQuotationHeaderCDSEntity, RentalQuotationHeaderEntity), tablenum(SalesQuotationCalculatedTotals), fieldstr(DNRRentalQuotationHeaderCDSEntity, SalesQuotationCalculatedTotalsRecId)]];

    return mapping;
}

public static void jumpRefMethod(str _menuItemName, Common _stagingBuffer, Object _callerObj, DataAreaId _dataAreaId)
{
    changeCompany(_dataAreaId)
